.txt\"\r","\r","# De ingelezen data uit het excelbestand\r","$Exceldata = [PSCustomObject]@{\r","        aantal = 0\r","        inhoud = @()\r","        geselecteert = \"\"\r","        uitvoermap = \"\"\r","        uitvoernaam = \"\"\r","        brinnummers = \"\"\r","        groepsidnrs = \"\"\r","        examendagen = \"\"\r","        vakcodes = \"\"\r","    }\r","\r","Function Empty_Exceldata {\r","# Leeg maken van array en standaard waarden geven\r","$Exceldata.aantal = 0\r","$Exceldata.inhoud = @()\r","$Exceldata.geselecteert = \"\"\r","$Exceldata.uitvoermap = [Environment]::GetFolderPath('MyDocuments')\r","$Exceldata.uitvoernaam = \"Facetbestand_\" + (Get-Date -Format \"yyyyMMdd_HHmmss\") # standaard uitvoernaam\r","$Exceldata.brinnummers = \"\"\r","$Exceldata.groepsidnrs = \"\"\r","$Exceldata.examendagen = \"\"\r","$Exceldata.vakcodes = \"\"\r","}\r","\r","Function declareren_standaardvenster {\r","param (\r","    [Parameter(Mandatory = $true)] [string]$titel,\r","    [Parameter(Mandatory = $true)] [string]$size_x,\r","    [Parameter(Mandatory = $true)] [string]$size_y\r",")\r","\r","$StandaardForm                            = New-Object system.Windows.Forms.Form\r","$StandaardForm.MaximumSize = New-Object System.Drawing.size($size_x,$size_y)\r","$StandaardForm.MinimumSize = New-Object System.Drawing.size($size_x,$size_y)\r","$StandaardForm.text                       = $titel\r","$StandaardForm.TopMost                    = $true\r","$StandaardForm.StartPosition              = 'CenterScreen'\r","# $StandaardForm.BackColor = \"white\"\r","$StandaardForm.MaximizeBox = $False\r","$StandaardForm.font                       = Standaardfont\r","$StandaardForm.Icon                       = [System.Drawing.Icon]::ExtractAssociatedIcon('cetool_icoon.ico')\r","\r","return $StandaardForm\r","} # einde declareren_standaardvenster\r","\r","Function Standaardfont {\r","    # Deze functie retourneert een standaard font voor de applicatie)\r","    $standaard = New-Object System.Drawing.Font('Microsoft Sans Serif',11)\r","    return $standaard\r","}\r","\r","function Write-Log {\r","    param(\r","        [Parameter(Mandatory = $true)] [string]$Message,\r","        [switch]$Notimestamp\r","        )\r","\r","    # datum en tijd van de log\r","    $timestamp = Get-Date -Format \"yyyy-MM-dd HH:mm:ss\"\r","\r","    # bericht naar tijdelijke log\r","    $tijdelijkelog = 'tijdelijkelog.txt'\r","    # als -Notimestamp is meegegeven dan een regel schrijven zonder de datum en tijd.\r","    if ($Notimestamp) {\r","        Set-Content -Path $tijdelijkelog -Value \"$Message\"\r","    } else {\r","        Set-Content -Path $tijdelijkelog -Value \"$timestamp`t$Message\"\r","    }\r","    \r","\r","    # oude inhoud inlezen, toevoegen aan tijdelijke bestand en oude bestand verwijderen\r","    $inhoudlog = Get-Content -path $LogFile\r","    Add-Content -Path $tijdelijkelog -Value $inhoudlog\r","    Remove-Item $LogFile\r","\r","    # naam wijzigen naar oude bestand\r","    Rename-Item -Path $tijdelijkelog -NewName $LogFile\r","    \r","} # einde Write-Log\r","\r","function Get-PNGImage {\r","    param([string]$path)\r","    if (Test-Path $path) {\r","        return [System.Drawing.Image]::FromFile($path)\r","    } else {\r","        return $null\r","    }\r","} # einde Get-PNGImage\r","\r","function SelectExcelForm {\r","    # Deze functie toont een dialoogvenster om een Excelbestand te selecteren\r","    # en retourneert het pad naar het geselecteerde bestand of 'GEEN' als er geen bestand is geselecteerd.\r","    $dialog = New-Object System.Windows.Forms.OpenFileDialog\r","    $dialog.Filter = \"Excel bestanden (*.xlsx)|*.xlsx\"\r","    $dialog.Title = \"Kies een Excelbestand\"\r","\r","    if ($dialog.ShowDialog() -eq \"OK\") {\r","        $selectedFile = $dialog.FileName\r","    } else {\r","        $selectedFile = 'GEEN'\r","    }\r","return $selectedFile\r","} # einde SelectExcelForm\r","\r","function Show-Logboek {\r","    \r","    $logForm = declareren_standaardvenster -titel \"Logboek\" -size_x 900 -size_y 400\r","\r","    $txtLog = New-Object System.Windows.Forms.TextBox\r","    #$txtLog.Dock = \"Fill\"\r","    $txtLog.Location = New-Object System.Drawing.Size(1,1) \r","    $txtLog.Size = New-Object System.Drawing.Size(880,310)\r","    $txtLog.Multiline = $true\r","    $txtLog.ReadOnly = $true\r","    # Om de tekst niet selecteerbaar te maken, dus in het blauw, moet tabstop = $false\r","    $txtLog.TabStop = $false\r","    # om beide scrollbars te zien moet wordwrap = $false en ScrollBars = 'Both'\r","    $txtLog.WordWrap = $false\r","    $txtLog.ScrollBars = 'Both'\r","    $txtLog.BackColor  = 'white'\r","    # $txtLog.font = Standaardfont\r","    $logForm.Controls.Add($txtLog)\r","\r","    # inlezen logbestand\r","    if (Test-Path $LogFile) {\r","        $txtLog.Text = Get-Content -Path $LogFile -Raw\r","        } else {\r","        $txtLog.Text = \"Logboek is leeg.\"\r","        }\r","\r","    # Voeg een sluitknop toe\r","    $btnClose = New-Object System.Windows.Forms.Button\r","    $btnClose.Text = \"Terug\"\r","    # $btnClose.Dock = \"Bottom\"\r","    $btnClose.location = \"50,320\" \r","    $btnClose.size = \"150,30\"\r","    $btnClose.BackColor = \"White\"\r","    $btnClose.DialogResult = [System.Windows.Forms.DialogResult]::cancel\r","    $logForm.Controls.Add($btnClose)\r","       \r","    $null = $logForm.ShowDialog()\r","} # einde Show-Logboek\r","\r","\r","function Add-Output {\r","    param([string]$text)\r","\r","    # Functie om tekst toe te voegen aan de TextBox. Wordt gebruikt bij Import-ExcelFile en Show_ExcelForm\r","    $outputBox.AppendText(\"$text`r`n\")\r","    $outputBox.SelectionStart = $outputBox.Text.Length\r","    $outputBox.ScrollToCaret()\r","}\r","\r","function Import-ExcelFile {\r","    param([string]$ExcelPath)\r","\r","    # alleen de naam weergeven en niet de volledige pas\r","    $naamexcel = Split-Path -Path $ExcelPath -Leaf\r","\r","    # weergeven in tekstbox en in console\r","    Write-Host \"Excelbestand $naamexcel wordt geopend.\"\r","    Add-Output \"Excelbestand $naamexcel wordt geopend.\"\r","\r","    # aanmaken object voor Excel en openen\r","    $excel = New-Object -ComObject Excel.Application\r","    Write-Host \"Excelbestand $naamexcel wordt ingelezen.\"\r","    Add-Output \"Excelbestand $naamexcel wordt ingelezen.\"\r","    $workbook = $excel.Workbooks.Open($ExcelPath)\r","    Write-Host \"Blad 1 wordt geopend.\"\r","    Add-Output \"Blad 1 wordt geopend.\"\r","    $sheet = $workbook.Sheets.Item(1)\r","    # tekst aanpassen aan inhoud zodat het goed ingelezen word.\r","    # $sheet.Columns.Item(\"F\").ColumnWidth = 20 \r","    $sheet.Columns.Item(\"A\").ColumnWidth = 20 \r","   \r","    $range = $sheet.UsedRange\r","    $data = @()\r","    $rowmax = $range.Rows.Count\r","\r","    Write-Host \"Rij 1 bevat de header en wordt overgeslagen.\"\r","    Add-Output \"Rij 1 bevat de header en wordt overgeslagen.\"\r","    # $huidetekst wordt gebruikt om de tekst \"Rij 2 van 10 wordt ingelezen\"op 1 regel te houden.\r","    # dit wordt gedaan door de huidge waarde te onthouden en dan steeds alleen 1 regel toe te voegen.\r","    $huidigetekst = $outputBox.text\r","    for ($row = 2; $row -le $rowmax; $row++) {\r","\r","        Write-Host \"`rRij $row van $rowmax wordt ingelezen.\" -NoNewline\r","        # Voor Add-Output kan niet hetzelfde worden gedaan als de regel hiervoor omdat het niet werkt.\r","        $outputBox.text = $huidigetekst + \"`nRij $row van $rowmax wordt ingelezen.\"\r","\r","        # lees de cellen in de rij\r","        $kolom2 = ($range.Cells.Item($row, 2)).Text\r","        $kolom1 = ($range.Cells.Item($row, 1)).Text\r","        if (![string]::IsNullOrWhiteSpace($kolom2) -and ![string]::IsNullOrWhiteSpace($kolom1)) {\r","            $line = [PSCustomObject]@{\r","                GroepsIdImport = $kolom1\r","                MapNaam        = $kolom2\r","                Kolom3        = ($range.Cells.Item($row, 3)).Text\r","                Kolom4        = ($range.Cells.Item($row, 4)).Text\r","                Kolom5        = ($range.Cells.Item($row, 5)).Text\r","                Kolom6        = ($range.Cells.Item($row, 6)).Text\r","                Kolom7        = ($range.Cells.Item($row, 7)).Text\r","                Kolom8        = ($range.Cells.Item($row, 8)).Text\r","                Kolom9        = ($range.Cells.Item($row, 9)).Text\r","                Kolom10        = ($range.Cells.Item($row, 10)).Text\r","                Kolom11        = ($range.Cells.Item($row, 11)).Text\r","                Kolom12        = ($range.Cells.Item($row, 12)).Text\r","                Kolom13        = ($range.Cells.Item($row, 13)).Text\r","                Kolom14        = ($range.Cells.Item($row, 14)).Text\r","                Kolom15        = ($range.Cells.Item($row, 15)).Text\r","                Kolom16        = ($range.Cells.Item($row, 16)).Text\r","                Kolom17        = ($range.Cells.Item($row, 17)).Text                \r","                Kolom18        = ($range.Cells.Item($row, 18)).Text\r","                Kolom19        = ($range.Cells.Item($row, 19)).Text\r","                Kolom20        = ($range.Cells.Item($row, 20)).Text\r","                Kolom21        = ($range.Cells.Item($row, 21)).Text\r","                Kolom22        = ($range.Cells.Item($row, 22)).Text                \r","                Kolom23        = ($range.Cells.Item($row, 23)).Text\r","                Kolom24        = ($range.Cells.Item($row, 24)).Text\r","                Kolom25        = ($range.Cells.Item($row, 25)).Text\r","                Kolom26        = ($range.Cells.Item($row, 26)).Text\r","                Kolom27        = ($range.Cells.Item($row, 27)).Text\r","                Kolom28        = ($range.Cells.Item($row, 28)).Text\r","            }\r","            $data += $line\r","        }\r","    }\r","    \r","    Write-Host \"\"  # Nieuwe regel na afloop\r","    Write-Host \"Data ingelezen.\"\r","    Write-Host \"Sluiten Excelbestand.\"\r","    Add-Output \"`n\"\r","    Add-Output \"Data ingelezen.\"\r","    # $outputBox.text = $outputBox.text + \"`nData ingelezen.\"\r","\r","    $workbook.Close($false)\r","    $excel.Quit()\r","\r","    [System.Runtime.Interopservices.Marshal]::ReleaseComObject($sheet) | Out-Null\r","    [System.Runtime.Interopservices.Marshal]::ReleaseComObject($workbook) | Out-Null\r","    [System.Runtime.Interopservices.Marshal]::ReleaseComObject($excel) | Out-Null\r","\r","    [gc]::Collect()\r","    [gc]::WaitForPendingFinalizers()\r","\r","    # Alles opslaan in Exceldata en een aantal gegevens om te controleren.\r","    # Het controleren gebeurt bij Show-ExcelForm\r","    \r","    Empty_Exceldata;\r","\r","    $Exceldata.geselecteert = $ExcelPath\r","    $Exceldata.inhoud = $data\r","    $Exceldata.aantal = $rowmax - 1 # aantal rijen minus de header\r","    # De gevonden brinnummers in de array zetten\r","    # Met Sort-object -Property Values wordt alles op alfabetisch volgorde gezet\r","    # met `r`n`t de regels onder elkaar en een tab naar rechts\r","    $brinnrs = $data | Group-Object -Property MapNaam | Sort-object -Property Values\r","       foreach ($brin in $brinnrs) {\r","        $Exceldata.brinnummers = -join ($Exceldata.brinnummers,\"`r`n`t\",$brin.name)\r","    }\r","    # De gevonden groepsIdImport-nummers in de array zetten\r","    $gr_id_imp_nrs = $data | Group-Object -Property GroepsIdImport | Sort-object -Property Values\r","    foreach ($gr_id in $gr_id_imp_nrs) {\r","        # $Exceldata.groepsidnrs = $Exceldata.groepsidnrs + $gr_id.name + \" - \"\r","        $Exceldata.groepsidnrs = -join ($Exceldata.groepsidnrs,\"`r`n`t\",$gr_id.name)\r","    }\r","    # De gevonden aantal dagen in de array zetten\r","    $alledagen = $data | Group-Object -Property kolom6 | Sort-object -Property Values\r","    foreach ($dag in $alledagen) {\r","        $Exceldata.examendagen = -join ($Exceldata.examendagen,\"`r`n`t\",$dag.name)\r","    }\r","    # De gevonden vakcodes in de array zetten\r","    $allevakcodes = $data | Group-Object -Property kolom12 | Sort-object -Property Values\r","    foreach ($vakcode in $allevakcodes) {\r","        $Exceldata.vakcodes = -join ($Exceldata.vakcodes,\"`r`n`t\",$vakcode.name)\r","    }\r","\r","} # einde Import-ExcelFile\r","\r","function Show-ExcelForm {\r","    param([string]$ExcelPath)\r","\r","    # Declareren venster met standaard waarden\r","    $ShowExcelForm = declareren_standaardvenster -titel \"De data wordt ingelezen.\" -size_x 600 -size_y 300\r","\r","    # TextBox voor statusoutput\r","    $outputBox = New-Object System.Windows.Forms.TextBox\r","    $outputBox.Multiline = $true\r","    $outputBox.ScrollBars = \"Vertical\"\r","    $outputBox.Size = New-Object System.Drawing.Size(560, 200)\r","    $outputBox.Location = New-Object System.Drawing.Point(10, 5)\r","    $outputBox.ReadOnly = $true\r","    $ShowExcelForm.Controls.Add($outputBox)\r","\r","    # Uitvoeren als Form is geladen. NB: .add_load werkt niet omdat de Form nog niet volledig is geladen.\r","    $ShowExcelForm.add_Shown({\r","    \r","        # importeren Excel\r","        if ($ExcelPath -ne 'GEEN') {\r","        Import-ExcelFile -ExcelPath $ExcelPath\r","        }\r"," \r","        # de tekst aanpassen na het inlezen\r","        $ShowExcelForm.text = \"Controleer de data die is ingelezen.\"\r","\r","        # aantal ingelezen regels overnemen. \r","        $aantal = $Exceldata.aantal\r","        $brinnrs = $Exceldata.brinnummers\r","        $grpidimp = $Exceldata.groepsidnrs\r","        $alle_dagen = $Exceldata.examendagen\r","        $vak_codes = $Exceldata.vakcodes\r","        # Weergeven in de TextBox\r","        Add-Output \" \"\r","        Add-Output \"Aantal ingelezen rijen : $aantal\"\r","        Add-Output \"`nBrinnummers : $brinnrs \"\r","        Add-Output \"Examendagen : $alle_dagen\"\r","        Add-Output \"Vakcodes : $vak_codes\"\r","        Add-Output \"GroepsIdImport : $grpidimp\"\r","        # Add-Output \" \"\r","\r","        # Nu de knoppen laten zien\r","        $btnBack = New-Object System.Windows.Forms.Button\r","        $btnBack.Text = \"Stoppen\"\r","        $btnBack.Location = '10,210'\r","        $btnBack.Size = '150,30'\r","        $btnBack.BackColor = \"White\"\r","        $btnBack.DialogResult = [System.Windows.Forms.DialogResult]::cancel\r","        $ShowExcelForm.Controls.Add($btnBack)\r","\r","        $btnReopen = New-Object System.Windows.Forms.Button\r","        $btnReopen.Text = \"Opieuw kiezen\"\r","        $btnReopen.Location = '170,210'\r","        $btnReopen.Size = '150,30'\r","        $btnReopen.BackColor = \"White\"\r","        $btnReopen.DialogResult = [System.Windows.Forms.DialogResult]::No\r","        $ShowExcelForm.Controls.Add($btnReopen)\r","\r","        $btnNext = New-Object System.Windows.Forms.Button\r","        $btnNext.Text = \"Bevestigen\"\r","        $btnNext.Location = '330,210'\r","        $btnNext.Size = '150,30'\r","        $btnNext.BackColor = \"White\"\r","        $btnNext.DialogResult = [System.Windows.Forms.DialogResult]::ok\r","        $ShowExcelForm.Controls.Add($btnNext)\r","    }) # Einde Form Load event\r","\r","    $result = $ShowExcelForm.ShowDialog()\r","\r","    $ShowExcelForm.Close()\r","\r","     if ($result -eq [system.windows.forms.dialogResult]::ok) { \r","         Show-ConvertForm\r","     } elseif ($result -eq [system.windows.forms.dialogResult]::No) {\r","                Write-Host \"Excelbestand opnieuw openen.\"\r","                $Geselecteerd = SelectExcelForm\r","                # terug naar het vorige scherm. Als $geselteerd = GEEN dan wordt bij Show-ExcelForm hier rekening mee gehouden \r","                Show-ExcelForm -ExcelPath $Geselecteerd\r","                \r","            } \r","} # einde Show-ExcelForm\r","\r","function Show-ConvertForm {\r","    # param([array]$Exceldata)\r","\r","    $convertForm = declareren_standaardvenster -titel \"Overzicht en opties wijzigen\" -size_x 600 -size_y 300\r","\r","    # geselecteerde Exceldata uit array halen\r","    $SelectedFile = Split-Path -Path $Exceldata.geselecteert -Leaf\r","    $outputname = $Exceldata.uitvoernaam\r","    $outputFolder = $Exceldata.uitvoermap\r","\r","    $lblSelected = New-Object System.Windows.Forms.Label\r","    $lblSelected.Text = \"Gekozen bestand: $SelectedFile\"\r","    $lblSelected.Location = '10,20'\r","    $lblSelected.Size = '590,30'\r","    $convertForm.Controls.Add($lblSelected)\r","\r","    $lblPath = New-Object System.Windows.Forms.Label\r","    $lblPath.Text = \"Uitvoermap:\"\r","    $lblPath.Location = '10,70'\r","    $lblPath.Size = '250,20'\r","    $convertForm.Controls.Add($lblPath)\r","\r","    $OutputPath = New-Object System.Windows.Forms.Label\r","    $OutputPath.Text = \"$outputFolder\"\r","    $OutputPath.Location = '10,90'\r","    $OutputPath.Size = '590,40'\r","    $convertForm.Controls.Add($OutputPath)\r","\r","    $lblOutput = New-Object System.Windows.Forms.Label\r","    $lblOutput.Text = \"Uitvoernaam:\"\r","    $lblOutput.Location = '10,130'\r","    $lblOutput.Size = '100,20'\r","    $convertForm.Controls.Add($lblOutput)\r","\r","    $txtOutput = New-Object System.Windows.Forms.TextBox\r","    $txtOutput.Location = '10,150'\r","    $txtOutput.Size = '300,20'\r","    $txtOutput.Text = $outputname\r","    $convertForm.Controls.Add($txtOutput)\r","\r","    $btnSelect = New-Object System.Windows.Forms.Button\r","    $btnSelect.Text = \"Wijzig uitvoermap\"\r","    $btnSelect.Location = '380,60'\r","    $btnSelect.Size = '200,30'\r","    $btnSelect.BackColor = \"White\"\r","    $btnSelect.Add_Click({\r","        # Outputmap selecteren\r","        $FolderBrowser = New-Object System.Windows.Forms.FolderBrowserDialog\r","        $FolderBrowser.Description = \"Selecteer de uitvoermap\"\r","\r","        if ($FolderBrowser.ShowDialog() -eq \"OK\") {\r","                $outputFolder = $FolderBrowser.SelectedPath\r","                $OutputPath.Text = \"$outputFolder\"\r","                Write-Host \"Andere uitvoermap gekozen: `n$outputFolder\"\r","        }    \r","    })\r","    $convertForm.Controls.Add($btnSelect)\r","\r","    $btnBack = New-Object System.Windows.Forms.Button\r","    $btnBack.Text = \"Stoppen\"\r","    $btnBack.Location = '10,190'\r","    $btnBack.Size = '150,30'\r","    $btnBack.BackColor = \"White\"\r","    $btnBack.DialogResult = [System.Windows.Forms.DialogResult]::cancel\r","    $convertForm.Controls.Add($btnBack)\r","\r","    $btnNext = New-Object System.Windows.Forms.Button\r","    $btnNext.Text = \"Omzetten\"\r","    $btnNext.Location = '180,190'\r","    $btnNext.Size = '150,30'\r","    $btnNext.BackColor = \"White\"\r","    # $btnNext.DialogResult = [System.Windows.Forms.DialogResult]::ok\r","    $btnNext.Add_Click({\r","        # Controleer of uitvoernaam is ingevuld\r","        if ([string]::IsNullOrWhiteSpace($txtOutput.Text)) {\r","            [System.Windows.Forms.MessageBox]::Show(\"Voer een uitvoernaam in.\", \"Foutmelding\", \"OK\", \"Error\")\r","            return\r","        }\r","        # Controleer of uitvoermap is ingevuld\r","        if ([string]::IsNullOrWhiteSpace($OutputPath.Text)) {\r","            [System.Windows.Forms.MessageBox]::Show(\"Selecteer een uitvoermap.\", \"Foutmelding\", \"OK\", \"Error\")\r","            return\r","        }\r","        # In de titel aangeven dat de data wordt omgezet\r","        $convertForm.Text = \"Data wordt omgezet naar Facet formaat...\"\r","        # Data weer in array zetten en naar procedure voor het omzetten\r","        $Exceldata.uitvoernaam = $txtOutput.Text\r","        $Exceldata.uitvoermap = $OutputPath.Text\r","        # en alleen outputbox zichtbaar\r","        $outputBox.Visible = $true\r","        \r","        # de knop om te sluiten is even niet klikbaar\r","        \r","        # alle andere knoppen en text onzichtbaar maken\r","        $btnBack.Visible = $false\r","        $btnSelect.Visible = $false\r","        $btnNext.Visible = $false\r","        $lblSelected.Visible = $false\r","        $lblPath.Visible = $false\r","        $lblOutput.Visible = $false\r","        $txtOutput.Visible = $false\r","        $OutputPath.Visible = $false\r","        # tijd geven om dit uit te voeren\r","        Start-Sleep -Milliseconds 100\r","\r","        # Starten omzetten\r","        Convert-ExcelToFacet\r","        # in de titel aangeven dat de data is omgezet\r","        $convertForm.Text = \"KLAAR! Data is omgezet naar Facet formaat.\"\r","        # de knop om te sluiten is weer klikbaar en tekst is veranderd\r","        $btnBack.Text = \"Sluiten\"\r","        $btnBack.Location = '10,220'\r","        $btnBack.Visible = $true\r","\r","    })\r","    $convertForm.Controls.Add($btnNext)\r","\r","    # TextBox voor statusoutput\r","    $outputBox = New-Object System.Windows.Forms.TextBox\r","    $outputBox.Multiline = $true\r","    $outputBox.ScrollBars = \"Vertical\"\r","    $outputBox.Size = New-Object System.Drawing.Size(560, 200)\r","    $outputBox.Location = New-Object System.Drawing.Point(10, 10)\r","    $outputBox.ReadOnly = $true\r","    $outputBox.Visible = $false # niet zichtbaar in het begin\r","    $convertForm.Controls.Add($outputBox)\r","\r","    $null = $convertForm.ShowDialog()\r","\r","    $convertForm.Close()\r","} # einde Show-ConvertForm\r","\r","function Convert-ExcelToFacet {\r","    \r","    # Dit is de logica om de Excel data om te zetten naar Facet formaat\r","   \r","    $BaseOutputFolder = Join-Path $PSScriptRoot \"Output\"\r","    $FinalZip = Join-Path $Exceldata.uitvoermap $Exceldata.uitvoernaam\r","    $FinalZip = -join ($FinalZip,'.zip')\r","    $zips = @()\r","\r","    Write-Host \"Omzetten van Excel data naar Facet formaat...\"\r","    Add-Output \"Omzetten van Excel data naar Facet formaat...\"\r","    # Tekst naar console en logbestand. Met `n wordt een nieuwe regel toegevoegd. Met `t wordt een tab toegevoegd.\r","    # De 1e regel is een lege regel, ook zonder datum en tijd.\r","    Write-Log -Message \" \" -Notimestamp\r","    Write-Log -Message \"Omzetten van Excel data naar Facet formaat is gestart.\r","    `tGekozen bestand: $($Exceldata.geselecteert)\r","    `tAantal ingelezen rijen: $($Exceldata.aantal)\r","    `tUitvoermap: $($Exceldata.uitvoermap)\r","    `tUitvoernaam: $($Exceldata.uitvoernaam)\"\r","    \r","    # Controleer of de uitvoermap bestaat en verwijderen als dit zo is. Vervolgens maak deze aan.\r","    if (Test-Path $BaseOutputFolder) { Remove-Item $BaseOutputFolder -Recurse -Force }\r","    New-Item -ItemType Directory -Path $BaseOutputFolder | Out-Null\r","\r","    # Alle groepen sorteren uit de Exceldata op mapnaam\r","    $groepen = $Exceldata.inhoud | Group-Object -Property MapNaam\r","    foreach ($groep in $groepen) {\r","        $groepFolder = Join-Path $BaseOutputFolder $groep.Name\r","        New-Item -ItemType Directory -Path $groepFolder | Out-Null\r","\r","        # Alle subgroepen sorteren uit de Exceldata op GroepsIdImport\r","        $subgroepen = $groep.Group | Group-Object -Property GroepsIdImport\r","\r","        foreach ($subgroep in $subgroepen) {\r","\r","            # voor aangepaste examens wordt een aparte xml gemaakt.\r","            # kolom 14 bepaald of het een aangepaste examen betreft.\r","            $aangepasten = $subgroep.Group | Group-Object -Property kolom14\r","\r","            foreach ($subaangepast in $aangepasten) {\r","            $xmlPath = Join-Path $groepFolder (\"$($subgroep.Name).xml\")\r","            # aangepast examen - xml bestand\r","            $xmlaangepast = Join-Path $groepFolder (\"$($subgroep.Name)_dos.xml\")\r","            # in kolom 14 wordt aangegeven of kandidaat een aangepaste examen aflegt - dan wordt aparte xml aangemaakt.\r","            $aangepastexamen = $subaangepast.group.kolom14\r","            \r","            if ([string]::IsNullOrWhiteSpace($aangepastexamen)) {\r","                New-XmlFile -DataRows $subaangepast.Group -OutputPath $xmlPath | Out-Null\r","                Write-Log -Message \"`tXML gemaakt: $($xmlPath)\" -Notimestamp\r","                Write-Host \"XML gemaakt: $($xmlPath)\"\r","                Add-Output \"XML gemaakt: $($xmlPath)\"\r","            } else {\r","                New-XmlFile -DataRows $subaangepast.Group -OutputPath $xmlaangepast | Out-Null\r","                Write-Log -Message \"`tXML gemaakt: $($xmlaangepast)\" -Notimestamp\r","                Write-Host \"XML gemaakt: $($xmlaangepast)\"\r","                Add-Output \"XML gemaakt: $($xmlaangepast)\"\r","            }\r","            }\r","        }\r","        # Nu de xml bestanden zijn aangemaakt, kan de zip bestand worden gemaakt.\r","        $zipPath = \"$groepFolder.zip\"\r","        Compress-Folder -FolderPath $groepFolder -ZipFilePath $zipPath\r","        Write-Log -Message \"`tGroepsmap aangemaakt : $groepFolder\" -Notimestamp\r","        Write-Host \"Groepsmap aangemaakt : $groepFolder\"\r","        Add-Output \"Groepsmap aangemaakt : $groepFolder\"\r","        # Toevoegen zip aan array met groepsmappen/ brinnummers\r","        $zips += $zipPath\r","\r","        Remove-Item $groepFolder -Recurse -Force\r","        # Write-Log -Message \"Map verwijderd: $groepFolder\"\r","        \r","    }\r","\r","    # tijdelijke map voor gezipte bestanden\r","    $mergeFolder = Join-Path $PSScriptRoot \"MergedTemp\"\r","    # deze verwijderen en opnieuw aanmaken. Dan is het zeker leeg.\r","    if (Test-Path $mergeFolder) { Remove-Item $mergeFolder -Recurse -Force }\r","    New-Item -ItemType Directory -Path $mergeFolder | Out-Null\r","\r","    # Nu de zip bestanden in de tijdelijke map zetten\r","    foreach ($z in $zips) {\r","        Copy-Item $z -Destination $mergeFolder\r","    }\r","\r","    # Nu de zip bestanden samenvoegen in 1 zip bestand. Dit is het uiteindelijke bestand.\r","    Compress-Folder -FolderPath $mergeFolder -ZipFilePath $FinalZip\r","    Write-Log -Message \"`tBestand aangemaakt: $FinalZip\" -Notimestamp\r","    Write-Host \"Bestand aangemaakt: $FinalZip\" -ForegroundColor Green\r","    Add-Output -Message \"Bestand aangemaakt: $FinalZip\"\r","\r","    # tijdelijke bestanden en mappen verwijderen\r","    Remove-Item $mergeFolder -Recurse -Force\r","    Remove-Item $BaseOutputFolder -Recurse -Force\r","    \r","    Write-Log -Message \"Klaar!\" \r","    Write-Host \"Klaar!\" -ForegroundColor Green\r","    \r","    Add-Output \"Bestand aangemaakt: $FinalZip\"\r","    Add-Output \" \"\r","    Add-Output \"===== Klaar! =====\"\r","\r","} # einde Convert-ExcelToFacet\r","\r","function New-XmlFile {\r","    # Hier wordt de xml aangemaakt adhv de gegeven $datarows en bewaard in $outputpath\r","\r","    param([array]$DataRows, [string]$OutputPath)\r","\r","    # Eenmalig Root element van de XML aanmaken\r","    [xml]$xmlDoc = New-Object System.Xml.XmlDocument\r","    $root = $xmlDoc.CreateElement(\"vastleggenAfnamegroep_V2\")\r","    $root.SetAttribute(\"xmlns\", \"http://duo.nl/schema/DUO_Examengegevens_V1.0\") | Out-Null   # Out-Null zorgt ervoor dat er geen tekst op de console komt\r","    $root.SetAttribute(\"xmlns:xsi\", \"http://www.w3.org/2001/XMLSchema-instance\") | Out-Null\r","    $xmlDoc.AppendChild($root)\r","\r","    # toevoegen van een extra letter aan de afnameleider en planner. A voor Albeda en een Z voor Zadkine.\r","    if ($DataRows[0].mapnaam -eq \"00GT\") {\r","        $extraletter = 'A'\r","        } elseif ($DataRows[0].mapnaam -eq \"25LP\") {\r","        $extraletter = 'Z'\r","        } else {\r","        # hier aangekomen betekent dat de brinnr niet correct is. De letter blijft leeg.\r","        $extraletter = ''\r","        }\r","\r","    # Eenmalig \u003cafnamegroep\u003e element aanmaken\r","    $afnamegroep = $xmlDoc.CreateElement(\"afnamegroep\")\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"groeps_id_import\")).InnerText = $DataRows[0].GroepsIdImport\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"bRIN\")).InnerText = $DataRows[0].mapnaam\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"bRINvolgnummer\")).InnerText = $DataRows[0].kolom3\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"naamexamengroep\")).InnerText = -join ($DataRows[0].kolom4,' ',$DataRows[0].kolom5)\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"naamexamenlokaal\")).InnerText = $DataRows[0].kolom5\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"examenafnamedatum\")).InnerText = $DataRows[0].kolom6\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"examenbegintijd\")).InnerText = $DataRows[0].kolom7\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"online_indicatie\")).InnerText = $DataRows[0].kolom8\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"inlognaamafnameplanner\")).InnerText = -join ($DataRows[0].kolom9,$extraletter)\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"inlognaamafnameleider\")).InnerText = -join ($DataRows[0].kolom10,$extraletter)\r","    \r","    # Eenmalig \u003cexamen\u003e\r","    $examen = $xmlDoc.CreateElement(\"examen\")\r","    $examen.AppendChild($xmlDoc.CreateElement(\"toetsgebruik\")).InnerText = $DataRows[0].kolom11\r","    $examen.AppendChild($xmlDoc.CreateElement(\"vakcode\")).InnerText = $DataRows[0].kolom12\r","    $examen.AppendChild($xmlDoc.CreateElement(\"opleidingniveau\")).InnerText = $DataRows[0].kolom13\r","    # Als kolom kandidaatbijzonderheid niet leeg is...\r","    $bijzonderheid = $DataRows[0].kolom14 \r","    if (![string]::IsNullOrWhiteSpace($bijzonderheid)) {\r","        $examen.AppendChild($xmlDoc.CreateElement(\"kandidaatbijzonderheid\")).InnerText = $bijzonderheid\r","    }\r","    $afnamegroep.AppendChild($examen)\r","\r","    # Per kandidaat een \u003cafname\u003e element aanmaken\r","    foreach ($row in $DataRows) {\r","        $afname = $xmlDoc.CreateElement(\"afname\")\r","\r","        $afname.AppendChild($xmlDoc.CreateElement(\"burgerservicenummer\")).InnerText = $Row.kolom15\r","        $afname.AppendChild($xmlDoc.CreateElement(\"inlognaam\")).InnerText = $Row.kolom16\r","        $afname.AppendChild($xmlDoc.CreateElement(\"verklankingIndicatie\")).InnerText = $Row.kolom17\r","        $afname.AppendChild($xmlDoc.CreateElement(\"geboortedatum\")).InnerText = $Row.kolom18\r","        $afname.AppendChild($xmlDoc.CreateElement(\"voornamen\")).InnerText = $Row.kolom19\r","\r","        $achternaam = $Row.kolom20\r","        if ($achternaam -like \"*,*\") {\r","            $split = $achternaam -split \",\"\r","            $afname.AppendChild($xmlDoc.CreateElement(\"voorvoegsels\")).InnerText = $split[1].Trim()\r","            $afname.AppendChild($xmlDoc.CreateElement(\"geslachtsnaam\")).InnerText = $split[0].Trim()\r","            \r","        } else {\r","            $afname.AppendChild($xmlDoc.CreateElement(\"geslachtsnaam\")).InnerText = $achternaam\r","        }\r","\r","        $afname.AppendChild($xmlDoc.CreateElement(\"geslacht\")).InnerText = $Row.kolom21\r","        $afname.AppendChild($xmlDoc.CreateElement(\"leerlingnummer\")).InnerText = $Row.kolom22\r","        $afname.AppendChild($xmlDoc.CreateElement(\"kenmerk1\")).InnerText = $Row.kolom23\r","        $afname.AppendChild($xmlDoc.CreateElement(\"kenmerk2\")).InnerText = $Row.kolom24\r","        $afname.AppendChild($xmlDoc.CreateElement(\"kenmerk3\")).InnerText = $Row.kolom25\r","        $afname.AppendChild($xmlDoc.CreateElement(\"wolfgroep\")).InnerText = $Row.kolom26\r","\r","        $afnamegroep.AppendChild($afname) | Out-Null\r","    }\r","\r","    # afnamegroep afsluiten en toevoegen --- Nog toevoegen1 en de andere hiervoor verwijderen!\r","    $afnamegroep.AppendChild($xmlDoc.CreateElement(\"aantalvarianten\")).InnerText = $DataRows[0].kolom27\r","    $root.AppendChild($afnamegroep) | Out-Null\r","\r","    $xmlDoc.Save($OutputPath)\r","}\r","\r","function Compress-Folder {\r","    # Hier wordt een zipbestand gemaakt adhv de 2 gegeven bestanden\r","\r","    param([string]$FolderPath, [string]$ZipFilePath)\r","\r","    if (Test-Path $ZipFilePath) {\r","        Remove-Item $ZipFilePath -Force\r","    }\r","    [System.IO.Compression.ZipFile]::CreateFromDirectory($FolderPath, $ZipFilePath)\r","}\r","\r","Function Controleerupdate {\r","    # Controleer of er een update is voor dit script\r","    Write-Host \"Controleer op updates.\"\r","\r","       # Declareren venster met standaard waarden\r","    $ControleerupdateForm = declareren_standaardvenster -titel \"Controleren op een update.\" -size_x 600 -size_y 300\r","\r","    # TextBox voor statusoutput\r","    $outputBox = New-Object System.Windows.Forms.TextBox\r","    $outputBox.Multiline = $true\r","    $outputBox.ScrollBars = \"Vertical\"\r","    $outputBox.Size = New-Object System.Drawing.Size(560, 200)\r","    $outputBox.Location = New-Object System.Drawing.Point(10, 5)\r","    $outputBox.ReadOnly = $true\r","    $ControleerupdateForm.Controls.Add($outputBox)\r","\r","    $ControleerupdateForm.Show()\r","    # nodig om proces de tijd te geven om de tekst te laten zien.\r","    Start-Sleep -Milliseconds 500  \r","\r","    # Vanaf hier start de controle op een update\r","    Add-Output \"Controleer op een update van dit script.\"\r","    Start-Sleep -s 5\r","    Add-Output \"Er is gecontroleerd op een update.\"\r","    Start-Sleep -s 5\r","   \r","\r","    # sluiten installatie scherm\r","    $ControleerupdateForm.dispose()\r","} # einde Controleerupdate\r","\r","# Functie om het hoofdmenu te tonen\r","# Deze functie toont het hoofdmenu van de applicatie\r","function Show-MainForm {\r","    $mainForm = declareren_standaardvenster -titel \"CE-tool omzetten Excel\" -size_x 400 -size_y 300\r","\r","    # Icoontjes laden\r","    $startIcon = Get-PNGImage \"$PSScriptRoot\\start.png\"\r","    $logIcon   = Get-PNGImage \"$PSScriptRoot\\logboek.png\"\r","    $exitIcon  = Get-PNGImage \"$PSScriptRoot\\stoppen.png\"\r","\r","    # Start Omzetten knop\r","    $btnStart = New-Object System.Windows.Forms.Button\r","    $btnStart.Text = \"Start Omzetten\"\r","    $btnStart.Size = '350,50'\r","    $btnStart.Location = '20,20'\r","    $btnStart.Image = $startIcon\r","    $btnStart.ImageAlign = \"MiddleLeft\"\r","    $btnStart.BackColor = \"White\"\r","    $btnStart.Add_Click({\r","        $mainForm.Hide() # Zorg dat hoofdmenu sluit\r","        $Geselecteerd = SelectExcelForm\r","        if ($Geselecteerd -ne 'GEEN') {\r","            # Import-ExcelFile -ExcelPath $Geselecteerd\r","            # Exceldata laten zien\r","            Show-ExcelForm -ExcelPath $Geselecteerd\r","        }\r","        $mainForm.Show()\r","    })\r","    $mainForm.Controls.Add($btnStart)\r","\r","    # Logboek bekijken knop\r","    $btnLog = New-Object System.Windows.Forms.Button\r","    $btnLog.Text = \"Logboek Bekijken\"\r","    $btnLog.Size = '350,50'\r","    $btnLog.Location = '20,90'\r","    $btnLog.Image = $logIcon\r","    $btnLog.ImageAlign = \"MiddleLeft\"\r","    $btnLog.BackColor = \"White\"\r","    $btnLog.Add_Click({\r","        $mainForm.Hide() # Zorg dat hoofdmenu sluit\r","        Show-Logboek\r","        $mainForm.Show()\r","    })\r","    $mainForm.Controls.Add($btnLog)\r","\r","    # Afsluiten knop\r","    $btnExit = New-Object System.Windows.Forms.Button\r","    $btnExit.Text = \"Afsluiten\"\r","    $btnExit.Size = '350,50'\r","    $btnExit.Location = '20,160'\r","    $btnExit.Image = $exitIcon\r","    $btnExit.ImageAlign = \"MiddleLeft\"\r","    $btnExit.BackColor = \"White\"\r","    $btnExit.Add_Click({\r","        $mainForm.Close()\r","    })\r","    $mainForm.Controls.Add($btnExit)\r","\r","    # zorgen dat deze venster altijd bovenop komt\r","    $mainForm.TopMost = $true\r","\r","    $null = $mainForm.ShowDialog()\r","} # einde Show-MainForm\r","\r","\r","############ start script ###############\r","\r","Controleerupdate;\r","\r","Show-MainForm;"],"stylingDirectives":[[[0,105,"pl-c"],[0,2,"pl-c"]],[[0,43,"pl-c"]],[[0,2,